/* layer_1_MatMul*/
static int tensor_layer_1_MatMul_output[1][INPUT_LAYER_SIZE_ROW];
/* layer_1_Add*/
static float tensor_layer_1_Add_output[1][INPUT_LAYER_SIZE_ROW];
/* layer_1_BN*/
static float tensor_layer_1_BN_output[1][INPUT_LAYER_SIZE_ROW];
/* layer_1_Tanh*/
static float tensor_layer_1_Relu_output[1][INPUT_LAYER_SIZE_ROW];

//node_layer_1_MatMul(tensor_input, tensor_layer_1_MatMul_weights, tensor_layer_1_MatMul_output)
static inline void node_layer_1_MatMul(const int A[1][1][1][INPUT_LAYER_SIZE_COL],
    const float Weights[INPUT_LAYER_SIZE_ROW][INPUT_LAYER_SIZE_COL],
    const float tensor_layer_1_Add_bias[INPUT_LAYER_SIZE_ROW],
    int Y[1][INPUT_LAYER_SIZE_ROW])
{

    printf("node_layer_1_MatMul \n");

    /* MatMul */
    for (uint32_t r = 0; r < 1; r++)
        for (uint32_t c = 0; c < INPUT_LAYER_SIZE_ROW; c++) {
            Y[r][c] = 0;
            for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
                Y[r][c] += BINARISE(A[0][0][r][i]) * BINARISE(Weights[c][i]) + BINARISE(tensor_layer_1_Add_bias[c]);
                printf("A[0][0][%d][%d] : %d\n", r, i, A[0][0][r][i]);
                printf("Y[%d][%d]: %d\n", r, c, Y[r][c]);
            }
        }

    printf("\n\n");
}

static inline void node_layer_1_ReLU(const float tensor_layer_1_Add_output[1][INPUT_LAYER_SIZE_ROW], float tensor_layer_1_Relu_output[1][INPUT_LAYER_SIZE_ROW])
{
    printf("node_layer_1_ReLU \n");
    for (unsigned i0 = 0; i0 < 1; i0++) {
        for (unsigned i1 = 0; i1 < INPUT_LAYER_SIZE_ROW; i1++) {
            tensor_layer_1_Relu_output[i0][i1] = RELU(tensor_layer_1_Add_output[i0][i1]);
            printf("tensor_layer_1_Relu_output[%d][%d]: %f\n", i0, i1, tensor_layer_1_Relu_output[i0][i1]);
        }
    }
}

static inline void node_layer_1_BN(const int Y[1][INPUT_LAYER_SIZE_ROW], float tensor_layer_1_BN_output[1][INPUT_LAYER_SIZE_ROW])
{
    printf("node_layer_1_BN \n");
    for (unsigned i0 = 0; i0 < 1; i0++) {
        for (unsigned i1 = 0; i1 < INPUT_LAYER_SIZE_ROW; i1++) {
            tensor_layer_1_BN_output[i0][i1] = ((float)Y[i0][i1] - tensor_layer_1_batch_mean[i1]) / (tensor_layer_1_batch_var[i1] + eps) * GAMMA;
            //printf("tensor_layer_1_BN_output[%d][%d]: %f\n", i0, i1, tensor_layer_1_BN_output[i0][i1]);
        }
    }
}

static inline void node_layer_Sigmoid(const float tensor_layer_2_Add_output[1][SECOND_LAYER_SIZE_ROW],
    float tensor_layer_2_Relu_output[1][SECOND_LAYER_SIZE_ROW])
{
    printf("node_layer_Sigmoid \n");
    for (unsigned i0 = 0; i0 < 1; i0++) {
        for (unsigned i1 = 0; i1 < SECOND_LAYER_SIZE_ROW; i1++) {
            tensor_layer_2_Relu_output[i0][i1] = HARD_SIGMOID(tensor_layer_2_Add_output[i0][i1]);
            printf("tensor_layer_2_Relu_output[%d][%d]: %f\n", i0, i1, tensor_layer_2_Relu_output[i0][i1]);
        }
    }
}



void entry(const int tensor_input[1][1][1][INPUT_LAYER_SIZE_COL], float tensor_output[1][INPUT_LAYER_SIZE_ROW]) {

    node_layer_1_MatMul(tensor_input, tensor_layer_1_MatMul_weights, tensor_layer_1_Add_bias, tensor_layer_1_MatMul_output);
    node_layer_1_BN(tensor_layer_1_MatMul_output, tensor_layer_1_BN_output);
    node_layer_1_ReLU(tensor_layer_1_BN_output, tensor_layer_1_Relu_output);

    node_layer_Sigmoid(tensor_layer_1_Relu_output, tensor_output);
}

int main()
{
    int tensor_input[1][1][1][INPUT_LAYER_SIZE_COL];
    float tensor_output[1][INPUT_LAYER_SIZE_ROW];

    for (int i = 0; i < INPUT_LAYER_SIZE_COL; i++) {
        tensor_input[0][0][0][i] = nondet_int();
        __ESBMC_assume((tensor_input[0][0][0][i] == -1) || (tensor_input[0][0][0][i] == 1));
    }


    for (int i = 0; i < 10; i++)
        printf("tensor_output[0][%d]: %f ", i, tensor_output[0][i]);

    entry(tensor_input, tensor_output);

    printf("Successful!!");


    for (int i = 0; i < 10; i++) {
        __ESBMC_assert(tensor_output[0][i] >= 0, "");
        __ESBMC_assert(tensor_output[0][i] <= 1, "");
    }

    return 0;
}



